import React from "react";
const Joblist =({address , firstname , lastname ,pnumber ,state})=>{



    return(
      <div>
        <p>Address: {address}</p>
        <p>firstname: {firstname}</p>
        <p>lastname:{lastname}</p>
        <p>Phone Number: {pnumber}</p>
        <p>state: {state}</p>
      </div>
    )



}

export default Joblist;
